CREATE DATABASE OnlineRetailStore;
USE OnlineRetailStore;
#
#TABLE STRUCTURE for Admin
#

DROP TABLE IF EXISTS Admin;
create table Admin (
	admin_id VARCHAR(8) NOT NULL,
	email_id VARCHAR(50) NOT NULL,
	password VARCHAR(50) NOT NULL,
	phone_number VARCHAR(50) NOT NULL,
	PRIMARY KEY (admin_id)
);

#
#TABLE STRUCTURE for Category
#

DROP TABLE IF EXISTS Category;
create table Category (
	category_id VARCHAR(11) NOT NULL,
	admin_id VARCHAR(8),
	category_name VARCHAR(17) NOT NULL,
	PRIMARY KEY(category_id),
	FOREIGN KEY(admin_id) REFERENCES Admin(admin_id)
);


#
#TABLE STRUCTURE for Product
#

DROP TABLE IF EXISTS Product;
create table Product (
	product_id VARCHAR(7) NOT NULL,
	category_id VARCHAR(11),
	admin_id VARCHAR(8),
	name VARCHAR(50) NOT NULL,
	description VARCHAR(50),
	price INT NOT NULL,
	stock INT NOT NULL,
	discount INT DEFAULT 0,
	PRIMARY KEY(product_id),
	FOREIGN KEY(category_id) REFERENCES Category(category_id),
	FOREIGN KEY(admin_id) REFERENCES Admin(admin_id)
);

#
#TABLE STRUCTURE for Cart
#

DROP TABLE IF EXISTS Cart;
create table Cart (
	cart_id VARCHAR(7) NOT NULL,
	cart_total_amount INT NOT NULL,
	PRIMARY KEY(cart_id)
);

#
#TABLE STRUCTURE for Customer
#

DROP TABLE IF EXISTS Customer;
create table Customer (
	customer_id VARCHAR(7) NOT NULL,
	cart_id VARCHAR(7),
	first_name VARCHAR(50) NOT NULL,
	last_name VARCHAR(50) NOT NULL,
	birth_date DATE NOT NULL,
	phone_number VARCHAR(50) ,
	email_id VARCHAR(50) NOT NULL,
	house_number INT NOT NULL,
	street VARCHAR(50) NOT NULL,
	city VARCHAR(50) NOT NULL,
	pincode INT NOT NULL,
	state VARCHAR(50),
	country VARCHAR(50) NOT NULL,
	points_earned INT,
	membership_status VARCHAR(6) NOT NULL,
	PRIMARY KEY(customer_id),
	FOREIGN KEY(cart_id) REFERENCES Cart(cart_id)

);


#
#TABLE STRUCTURE for Coupon
#

DROP TABLE IF EXISTS Coupon;
create table Coupon (
	coupon_id VARCHAR(6) NOT NULL,
	admin_id VARCHAR(8),
	coupon_code VARCHAR(50) NOT NULL,
	percentage_discount INT NOT NULL,
	description VARCHAR(25) NOT NULL,
	PRIMARY KEY(coupon_id),
	FOREIGN KEY(admin_id) REFERENCES Admin(admin_id)
);

#
#TABLE STRUCTURE for Authentication_credentials
#

DROP TABLE IF EXISTS Authentication_credentials;
create table Authentication_credentials (
	customer_id VARCHAR(7),
	login_id INT NOT NULL,
	password VARCHAR(50) NOT NULL,
	FOREIGN KEY(customer_id) REFERENCES Customer(customer_id)
);



#
#TABLE STRUCTURE for Cart_item
#

DROP TABLE IF EXISTS Cart_item;
create table Cart_item (
	cart_id VARCHAR(7),
	product_id VARCHAR(7),
	quantity INT NOT NULL,
	FOREIGN KEY(cart_id) REFERENCES Cart(cart_id),
	FOREIGN KEY(product_id) REFERENCES Product(product_id)
);



#
#TABLE STRUCTURE for Shipper
#

DROP TABLE IF EXISTS Shipper;
create table Shipper (
	shipper_id VARCHAR(10) NOT NULL,
	shipper_name VARCHAR(50) NOT NULL,
	PRIMARY KEY(shipper_id)
);


#
#TABLE STRUCTURE for Transaction
#

DROP TABLE IF EXISTS Transaction;
create table Transaction (
	transaction_id VARCHAR(8),
	customer_id VARCHAR(7),
	`date-time` DATE NOT NULL,
	amount INT NOT NULL,
	credit_debit_status VARCHAR(6),
	PRIMARY KEY(transaction_id),
	FOREIGN KEY(customer_id) REFERENCES Customer(customer_id)
);



#
#TABLE STRUCTURE for Order
#

DROP TABLE IF EXISTS `Order`;
create table `Order` (
	order_id VARCHAR(8) NOT NULL,
	customer_id VARCHAR(7),
	coupon_id VARCHAR(6),
	transaction_id VARCHAR(8),
	shipper_id VARCHAR(10),
	order_status VARCHAR(10) NOT NULL,
	order_date DATE NOT NULL,
	shipping_date DATE NOT NULL,
	house_number INT NOT NULL,
	street VARCHAR(50) NOT NULL,
	city VARCHAR(50) NOT NULL,
	pincode INT NOT NULL,
	state VARCHAR(50),
	country VARCHAR(50) NOT NULL,
	tax INT NOT NULL,
	delivery_charges INT NOT NULL,
	total_amount INT NOT NULL,
	net_amount INT NOT NULL,
	payment_status VARCHAR(8) NOT NULL,
	PRIMARY KEY(order_id),
	FOREIGN KEY(customer_id) REFERENCES Customer(customer_id),
	FOREIGN KEY(coupon_id) REFERENCES Coupon(coupon_id),
	FOREIGN KEY(transaction_id) REFERENCES Transaction(transaction_id),
	FOREIGN KEY(shipper_id) REFERENCES Shipper(shipper_id)
);


#
#TABLE STRUCTURE for Order_item
#

DROP TABLE IF EXISTS Order_item;
create table Order_item (
	order_id VARCHAR(8),
	product_id VARCHAR(7),
	quantity INT NOT NULL,
	price INT NOT NULL,
	discount INT NOT NULL,
	FOREIGN KEY(order_id) REFERENCES `Order`(order_id),
	FOREIGN KEY(product_id) REFERENCES Product(product_id)
);

#
#TABLE STRUCTURE for Product_image
#

DROP TABLE IF EXISTS Product_image;
create table Product_image (
	product_id VARCHAR(7),
	product_image VARCHAR(50),
	FOREIGN KEY(product_id) REFERENCES Product(product_id)
);
